FROM (select SUM(dtt.n) as positivos_totales , 4 as id
      from dataset_testeo_turismo as dtt
      where dtt.tipo = ''positivos'') AS t1 JOIN
      (select SUM(tt.n) as testeos_totales, 4 as id
       from dataset_testeo_turismo as tt
       where tt.tipo = ''testeos'') AS t2 ON t1.id = t2.id JOIN
       (
        SELECT  df.fecha_muestra  as fecha, 4 as id
        from dataset_testeo_turismo as df
        order by df.fecha_muestra desc
        LIMIT 1
