INSERT INTO public.db_views_vista (id, nombre, sql, descripcion, output_ex, nombre_anterior) VALUES (147, 'dataset_acumulado_etareo_turista', 'SELECT 1 as id, 2 as fecha, tt.grupo_etario as eje_x, SUM(tt.n)::INT as eje_y, round((tabla2.cantidad_de_testeos * 100)/ SUM(tt.n))::INT as eje_y2
FROM dataset_testeo_turismo AS tt JOIN
     (
        SELECT grupo_etario, SUM(n) as cantidad_de_testeos
        FROM dataset_testeo_turismo
        GROUP BY grupo_etario, tipo
        HAVING tipo IN (''positivos'')
     ) as tabla2 ON tabla2.grupo_etario = tt.grupo_etario
GROUP BY tt.grupo_etario, tt.tipo, tabla2.cantidad_de_testeos
HAVING tt.tipo NOT IN (''positivos'')
ORDER BY tt.grupo_etario ASC;', 'dataset_acumulado_etareo_turista', 'Columna: id Tipo: integer
