INSERT INTO public.db_views_vista (id, nombre, sql, descripcion, output_ex, nombre_anterior) VALUES (133, 'dataset_positivo_turista_diario', 'SELECT t.id, t.fecha, t.eje_x, concat(round((t.eje_y * 100)/ tot.testeos_total_por_dia)::INT, ''%'') as eje_y2
FROM (SELECT 1 as id, tt.fecha_muestra AS fecha, to_char(tt.fecha_muestra,''DD-MM'') as eje_x, sum(tt.n)::int AS eje_y
      FROM dataset_testeo_turismo as tt
      WHERE tt.tipo=''positivos''
      GROUP BY fecha
      ORDER BY tt.fecha_muestra DESC
      LIMIT 30) AS t
      JOIN (
          SELECT to_char(dtt.fecha_muestra,''DD-MM'') as fecha, SUM(dtt.n) as testeos_total_por_dia
          FROM dataset_testeo_turismo as dtt
          GROUP BY dtt.fecha_muestra, dtt.tipo
          HAVING dtt.tipo NOT IN (''positivos'')
          ORDER BY fecha
      ) AS tot ON tot.fecha = t.eje_x
order by t.fecha;', 'dataset_positivo_turista_diario', 'Columna: id Tipo: integer
Columna: fecha Tipo: date
Columna: eje_x Tipo: text
Columna: eje_y2 Tipo: text
------------------------------
Ejemplo: 
(1, datetime.date(2021, 1, 24), ''24-01'', ''3%'')', 'dataset_positivo_turista_diario');
