INSERT INTO public.db_views_vista (id, nombre, sql, descripcion, output_ex, nombre_anterior) VALUES (146, 'dataset_positivo_turista_fecha_testeo_edad', 'SELECT 1 AS id, tercer_grupo.fecha,
       to_char(tercer_grupo.fecha ,''DD-MM'') AS eje_x,
       primer_grupo.eje_y::int AS eje_y,
       segundo_grupo.eje_y::int AS eje_y2,
       tercer_grupo.eje_y::int AS eje_y3
 FROM (
       SELECT tabla1.fecha as fecha, tabla1.eje_x as eje_x, cast(round(coalesce(nullif((tabla2.eje_y * 100)::decimal/tabla1.eje_y,null),''0'') , 0) as varchar) AS eje_y 
		FROM (
				SELECT dataset_testeo_turismo.fecha_muestra AS fecha,
					   dataset_testeo_turismo.fecha_muestra AS eje_x,
					   sum(dataset_testeo_turismo.n::integer) AS eje_y
				FROM dataset_testeo_turismo
				WHERE (dataset_testeo_turismo.tipo::text = ''testeos''::text and dataset_testeo_turismo.grupo_etario = ''0-19'') or (dataset_testeo_turismo.tipo::text = ''testeos''::text and dataset_testeo_turismo.grupo_etario = ''20-29'')
				GROUP BY dataset_testeo_turismo.fecha_muestra
				ORDER BY dataset_testeo_turismo.fecha_muestra
			  ) AS tabla1 LEFT JOIN
			  (
				 SELECT dataset_testeo_turismo.fecha_muestra AS fecha,
					   dataset_testeo_turismo.fecha_muestra AS eje_x,
					   sum(dataset_testeo_turismo.n::integer) AS eje_y
				FROM dataset_testeo_turismo
				WHERE (dataset_testeo_turismo.tipo::text = ''positivos''::text and dataset_testeo_turismo.grupo_etario = ''0-19'') or (dataset_testeo_turismo.tipo::text = ''positivos''::text and dataset_testeo_turismo.grupo_etario = ''20-29'')
				GROUP BY dataset_testeo_turismo.fecha_muestra
				ORDER BY dataset_testeo_turismo.fecha_muestra 
			  ) AS tabla2 ON tabla1.fecha = tabla2.fecha
     ) primer_grupo
    JOIN (
        	SELECT tabla1.fecha as fecha, tabla1.eje_x as eje_x, cast(round(coalesce(nullif((tabla2.eje_y * 100)::decimal/tabla1.eje_y,null),''0'') , 0) as varchar) AS eje_y 
			FROM (
					SELECT dataset_testeo_turismo.fecha_muestra AS fecha,
						   dataset_testeo_turismo.fecha_muestra AS eje_x,
						   sum(dataset_testeo_turismo.n::integer) AS eje_y
					FROM dataset_testeo_turismo
					WHERE (dataset_testeo_turismo.tipo::text = ''testeos''::text and dataset_testeo_turismo.grupo_etario = ''30-39'') or (dataset_testeo_turismo.tipo::text = ''testeos''::text and dataset_testeo_turismo.grupo_etario = ''40-49'') or (dataset_testeo_turismo.tipo::text = ''testeos''::text and dataset_testeo_turismo.grupo_etario = ''50-59'')
					GROUP BY dataset_testeo_turismo.fecha_muestra
					ORDER BY dataset_testeo_turismo.fecha_muestra
				  ) AS tabla1 LEFT JOIN
				  (
					 SELECT dataset_testeo_turismo.fecha_muestra AS fecha,
						   dataset_testeo_turismo.fecha_muestra AS eje_x,
						   sum(dataset_testeo_turismo.n::integer) AS eje_y
					FROM dataset_testeo_turismo
					WHERE (dataset_testeo_turismo.tipo::text = ''positivos''::text and dataset_testeo_turismo.grupo_etario = ''30-39'') or (dataset_testeo_turismo.tipo::text = ''positivos''::text and dataset_testeo_turismo.grupo_etario = ''40-49'') or (dataset_testeo_turismo.tipo::text = ''positivos''::text and dataset_testeo_turismo.grupo_etario = ''50-59'')  
					GROUP BY dataset_testeo_turismo.fecha_muestra
					ORDER BY dataset_testeo_turismo.fecha_muestra 
				  ) AS tabla2 ON tabla1.fecha = tabla2.fecha
	     ) segundo_grupo
        ON segundo_grupo.fecha = primer_grupo.fecha
    JOIN (
          SELECT tabla1.fecha as fecha, tabla1.eje_x as eje_x, cast(round(coalesce(nullif((tabla2.eje_y * 100)::decimal/tabla1.eje_y,null),''0'') , 0) as varchar) AS eje_y
		  FROM (
					SELECT dataset_testeo_turismo.fecha_muestra AS fecha,
						   dataset_testeo_turismo.fecha_muestra AS eje_x,
						   sum(dataset_testeo_turismo.n::integer) AS eje_y
					FROM dataset_testeo_turismo
					WHERE (dataset_testeo_turismo.tipo::text = ''testeos''::text and dataset_testeo_turismo.grupo_etario = ''60-69'') or (dataset_testeo_turismo.tipo::text = ''positivos''::text and dataset_testeo_turismo.grupo_etario = ''70-79'') or (dataset_testeo_turismo.tipo::text = ''testeos''::text and dataset_testeo_turismo.grupo_etario = ''80 y más'')
					GROUP BY dataset_testeo_turismo.fecha_muestra
					ORDER BY dataset_testeo_turismo.fecha_muestra
				  ) AS tabla1 LEFT JOIN
				  (
					 SELECT dataset_testeo_turismo.fecha_muestra AS fecha,
						   dataset_testeo_turismo.fecha_muestra AS eje_x,
						   sum(dataset_testeo_turismo.n::integer) AS eje_y
					FROM dataset_testeo_turismo
					WHERE (dataset_testeo_turismo.tipo::text = ''positivos''::text and dataset_testeo_turismo.grupo_etario = ''60-69'') or (dataset_testeo_turismo.tipo::text = ''positivos''::text and dataset_testeo_turismo.grupo_etario = ''70-79'') or (dataset_testeo_turismo.tipo::text = ''positivos''::text and dataset_testeo_turismo.grupo_etario = ''80 y más'')
					GROUP BY dataset_testeo_turismo.fecha_muestra
					ORDER BY dataset_testeo_turismo.fecha_muestra 
				  ) AS tabla2 ON tabla1.fecha = tabla2.fecha
	     ) tercer_grupo
        ON primer_grupo.fecha = tercer_grupo.fecha
 ORDER BY tercer_grupo.fecha;', 'dataset_positivo_turista_fecha_testeo_edad', 'Columna: id Tipo: integer
Columna: fecha Tipo: date
Columna: eje_x Tipo: text
Columna: eje_y Tipo: integer
Columna: eje_y2 Tipo: integer
Columna: eje_y3 Tipo: integer
