INSERT INTO public.db_views_vista (id, nombre, sql, descripcion, output_ex, nombre_anterior) VALUES (192, 'dataset_turnos_concurridos_y_citas_del_personal_de_salud', 'SELECT 1 AS id, tabla1.fecha_cita as fecha,
       to_char(tabla1.fecha_cita ,''DD-MM'') AS eje_x,
	   coalesce(nullif(tabla1.cantidad,null),''0'')::int AS eje_y
FROM(SELECT tcp.fecha_cita , SUM(tcp.cantidad) as cantidad
		FROM(
				SELECT CAST(dtd.fecha_cita as Date) as fecha_cita, count(*) as cantidad, dtd.estado
				FROM dataset_turnos_detalle as dtd
				where servicio NOT LIKE ''%Mayores 80 años%'' 
				GROUP BY fecha_cita, dtd.estado, dtd.servicio

			) AS tcp
		GROUP BY tcp.fecha_cita
	) as tabla1
ORDER BY fecha asc;', 'dataset_turnos_concurridos_y_citas_del_personal_de_salud', 'Columna: id Tipo: integer
